import React from "react";
import { NavLink } from "react-router-dom";
import { useAuth } from "./LoginContext";

function NavBar() {
  const { user } = useAuth();

  return (
    <div>

        <div id="home-page-container-3">



        className="social-icons">
          <NavLink to="https://www.facebook.com/">
            <img
              id="facebook"
              src={process.env.PUBLIC_URL + "/images/homepage/Home3.png"}
              alt="facebook-icon"
            />
          </NavLink>
          <NavLink to="https://instagram.com/">
            <img
              id="instagram"
              src={process.env.PUBLIC_URL + "/images/homepage/Home5.png"}
              alt="instagram-icon"
            />
          </NavLink>
          <NavLink to="https://twitter.com">
            <img
              id="twitter"
              src={process.env.PUBLIC_URL + "/images/homepage/Home4.png"}
              alt="twitter-icon"
            />
          </NavLink>
        </div>
      </div>

  );
}

export default NavBar;
